<!DOCTYPE html>
<html>
<head>
  <meta http-equiv="Content-Type" content="text/html; charset=utf-8" />
  <link rel="icon" type="image/icon" href="/favicon.ico" />
<style type="text/css">
/* reset */
/* $Id$ */
html, body, div, span, h1, h2, h3, h4, h5, h6, p, a, em,  img, strong, sub, sup, b, u, i,  dl, dt, dd, ol, ul, li, form, label, table, tbody, tfoot, thead, tr, th, td {
        margin: 0;
        padding: 0;
        border: 0;
        outline: 0;
        vertical-align: baseline;
        background: transparent;
}
html {
  font-size: 100.01%;
  overflow-y: scroll;
}
body {
  line-height: 1;
  background: #fff;
  color: #000;
  text-align: left;
  font: 12px Arial, "Helvetica CY", "Nimbus Sans L", sans-serif;
}


ol, ul {
  list-style: none; 
}


:focus {
  outline: 0;
}


table {
        border-collapse: collapse;
        border-spacing: 0;
  font-size: 100%;
}
a {
  color: #287fc3;
  text-decoration: underline;
}
input[type="text"], input[type="password"] {
  font-size: 100%;
  padding: 0;
}
textarea {
  font: 100% Arial,  sans-serif;
  padding: 0;
}

/* ie6 */

* html.formText {
  font-size: 100%;
  padding: 0;
}
* html input {
  z-index: expression(
    runtimeStyle.zIndex = 1,
    type == "text" ? (className += " formText") : 0,
    type == "password" ? (className += " formText") : 0
  )
}
/* end reset */

/*------------ <layout> -----------*/
html, body{
  height: 100%;
  min-width: 960px;
}
/*хак для ие-6 (прижатие футера к низу)*/
* html #main{
  height: 100%;
}

#main {
  height: 100%;
  position: relative;
}
#header {
  height: 40%;
}
#header #header-inner{
  min-width: 960px;
  max-width: 1137px;
  margin: 0 auto;
  position: relative;
}

#content{
  position: relative;
  height: 60%;
  min-width: 900px;
  max-width: 1077px;
  margin: 0 auto;
  padding: 0 29px 0 31px;
}

#girl-image {
  bottom:0;
  left: 10px;
  position: absolute;
  height:100%;
  z-index: 1;
}
#error404-wrapper {
  float:right;
  width: 500px;
  font: normal normal normal 18px/18px Arial, "Geneva CY", sans-serif;
  color: white;
  margin-top: 35px;
  position: relative;
  z-index: 10;
}
/*------------ </layout> -----------*/

/*------------ <header> -----------*/
body {
  background: url("data:image/png;base64,") center top;
}

#logo-slogan-wrapper {
  padding: 30px 0 0 25px;

}
#site-slogan {
  color: white;
  font-size: 11px;
}

/*------------ </header> -----------*/
</style>

  <title>Jollyday :: Сайт на обслуживании</title>

</head>

<body>
  <div id="header">
      <div id="header-inner">
          <div id="logo-slogan-wrapper" class="header-top-block">
            <div id="logo">
                <a href="/site/index"><img src="data:image/png;base64," alt="logo">
                </a>
            </div>
            <div id="site-slogan">Бесплатный сайт знакомств и реальных свиданий в один клик</div>
          </div>
      </div>
    </div><!-- header -->
    <div id="content">
      <div id="error404-wrapper">
        <div id="message">
            Извините, на сайте ведутся технические работы.
        </div>
      </div>
      <img id="girl-image" src="data:image/png;base64,">
    </div>
</body>
</html>

